import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Contact = () => {
  const [context, setContext] = useState(null);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/my_information/')
      .then(response => setContext(response.data.my_info))
      .catch(error => console.error('Error fetching context:', error));
  }, []);

  // if (!context) {
  //   return <div>Loading...</div>;
  // }

  return (
    <div>
      <h1>Contact Page</h1>
      <p>{context.my_title}</p>
      {context.posts && context.posts.map(post => (
        <div key={post.id}>
          <h2>{post.title}</h2>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
};

export default Contact;
